<script type="text/javascript">

        function refreshChart(strChart, oOption) {
            require.config({
                paths: { echarts: 'js' }
            });
            require(
				['echarts', 'echarts/chart/line'],
				function (ec) {
				    chtOverlay = ec.init(document.getElementById(strChart));
					var eConfig = require('echarts/config');
				    chtOverlay.setOption(oOption);
					chtOverlay.on(eConfig.EVENT.HOVER, eConsole);
					chtOverlay.on(eConfig.EVENT.CLICK, eConsole);
				}
			);
        }
		function eConsole(param){
			return;
			var mes = 'BatchId: ' + param.seriesName;
			if (typeof nPeventStartPos !='undefined' ){
				var strStepName = aryEvt[param.data[1]];
				if (typeof strStepName != 'undefined'){
					mes += '; StepNumber:' + strStepName;
				}		
			}
						
			//alert ('event');
			var ele;
			//console.log(param);
			var elements = getElementsStartsWithId('extraInfo');
			for (var i =0; elements.length; i++){
				//console.log(elements[i]);
				//if (typeof elements[i] != 'undefined'){
					elements[i].innerHTML = mes;
				//}
			}
			//document.getElementById('popup').style.display = 'block';
			//console.log(param);
			
		}
		function refreshCharts(strChart, oOptions){
			var charts = [];
			require.config({
                paths: { echarts: 'js' }
            });
			require(
				['echarts', 'echarts/chart/line'],
				function (ec) {
					var eConfig = require('echarts/config');
					for (i=0;i<oOptions.length; i++){
						charts.push(ec.init(document.getElementById(strChart + i)));
						charts[i].setOption(oOptions[i]);
						charts[i].on(eConfig.EVENT.HOVER, eConsole);
					}
					//here connect all the charts behavior together
				    for (i=0; i<oOptions.length; i++){
						var chartList = [];
						for (var j=0; j<oOptions.length; j++){
							if (i!=j){
								chartList.push(charts[j]);
							}
						}
						charts[i].connect(chartList);
					}
				    //chtOverlay.setOption(oOption);
				}
			);
		}
</script>

<script type="text/javascript">
    function injectGraphsHtml(nCount) {
	        var strTemp = '';
	        for (var i = 0; i < nCount; i++) {
	            strTemp += '<div id="overlayChart' + i + '" style="height:500px"></div><p id ="extraInfo' +i + '" align="center">More information</p>';
	        }
	        document.getElementById("chartArea").innerHTML = strTemp;
	    }
	    function Right(str, n) {
	        if (n <= 0)
	            return "";
	        else if (n > String(str).length)
	            return str;
	        else {
	            var iLen = String(str).length;
	            return String(str).substring(iLen - n, iLen);
	        }
	    };
	    function cloneObject(obj) {
	        if (obj === null || typeof obj !== 'object') {
	            return obj;
	        }
	        var temp = obj.constructor(); // give temp the original obj's constructor
	        for (var key in obj) {
	            temp[key] = cloneObject(obj[key]);
	        }
	        return temp;
	    }
		function getElementsStartsWithId( id ) {
		  var children = document.body.getElementsByTagName('*');
		  var elements = [], child;
		  for (var i = 0, length = children.length; i < length; i++) {
			child = children[i];
			if (child.id.substr(0, id.length) == id)
			  elements.push(child);
		  }
		  return elements;
		}
	    function onUpdate() {
	        loadGraph();
	    };
	    //this function loads the contents of the dataset and prepares for the chart data
	    function loadGraph() {
	        var dsTabName = [];
	        var dsSeriesName = []; //data set for the series names, which are the batch ids.
	        var dsLeftAxis = []; //the data set for left axis (profile data), it's a three dimensional array first dim is tab, second dim is profile, third contains the value pairs.
	        var dsRightAxis = new Array(); //the data for right axis -- the reference data
	        var dsStepTimeStamp = [];
	        var dsDeltaTime = [];
	        var dsSeriesStartTime = [];
	        var strTempBatchId = '';
	        var nTabId, nSeriesId, i, j;
	        var nTimeDelta;

		if (nLineUpStep == '' || nLineUpStep == undefined) {
			nLineUpStep = 100;
		}

        if (strReferenceLine == '' || strReferenceLine == undefined) {
            strReferenceLine = '_SSTEP'
        }

        //var strReferenceLine = '_SSTEP'; //todo: change this to sstep in the production code
	      var nPrevStep;
	        //first identify all the tabs and series (batches), as well as batch start, end times, plus offset values
	        for (i = 1; i < dataSet.length && (typeof dataSet[i][4] !== "undefined"); i++) {
	            if (dataSet[i][4] != '' && dataSet[i][5] != 'yRight' && dsTabName.indexOf(dataSet[i][4]) == -1) { //check if the index of tabname, if it doesn't exist, add it
	                dsTabName.push(dataSet[i][4]);
	            }
	            //get all the series(batchid)
	            if (dataSet[i][3] != ''
						//&& (Right(dataSet[i][2], strReferenceLine.length)).toUpperCase() == strReferenceLine //the value equals the line up step 
						&& (Right(dataSet[i][2], 7)).toUpperCase() == '_PEVENT' //the value equals the line 
                        && dsSeriesName.indexOf(dataSet[i][3]) == -1 //the series name doesn't exist yet
						&& dataSet[i][1] == nLineUpStep.toString()
					) {
	                dsSeriesName.push(dataSet[i][3]);
	                //dsDeltaTime.push(Date.parse(dataSet[i][0]) / 1000);
					dsDeltaTime.push( (new Date(dataSet[i][0])) / 1000);
	            }
	        }
	        //now add the series and tab data into a big dataset			
	        //prepare the dimensions of the dataset
	        for (i = 0; i < dsTabName.length; i++) {
	            dsLeftAxis.push([]);
	            for (j = 0; j < dsSeriesName.length; j++) {
	                dsLeftAxis[i].push([]);
	            }
	        }
	        for (i = 0; i < dsSeriesName.length; i++) {
	            dsRightAxis.push([]);
	        }

	        nPrevStep = 0;
	        for (i = 1; i < dataSet.length; i++) { //skip the first row, which contains the column headers
	            nSeriesId = dsSeriesName.indexOf(dataSet[i][3]);
	            if (nSeriesId != -1) {
	                nTimeDelta = dsDeltaTime[nSeriesId];
	                var dt = new Date(dataSet[i][0]);
	                //here add the right axis data, note we need to generate the steps
	                if (dataSet[i][5] == 'yRight') {
	                    if (nPrevStep != parseInt(dataSet[i][1])) {
	                        dsRightAxis[nSeriesId].push([dt / 1000 - nTimeDelta - 1, nPrevStep]);
	                    }
	                    dsRightAxis[nSeriesId].push([dt / 1000 - nTimeDelta, dataSet[i][1]]);
	                    nPrevStep = parseInt(dataSet[i][1]);
	                }
	                //add the time-value paire to their corresponding tab-series arrays
	                if (dataSet[i][5] == 'yLeft' && dataSet[i][4] != '') {
	                    nTabId = dsTabName.indexOf(dataSet[i][4]);
	                    //nSeriesId = dsSeriesName.indexOf(dataSet[i][3]);
	                    if (nTabId >= 0 && nSeriesId >= 0) {
	                        dsLeftAxis[nTabId][nSeriesId].push([dt / 1000 - nTimeDelta, dataSet[i][1]]);
	                    }
	                }
	            }
	        }
	        //now connect them with the chart options
	        injectGraphsHtml(dsTabName.length); //create place holder htmls for the graphics
			var opts = [];
	        for (i = 0; i < dsTabName.length; i++) {
	            var opt = cloneObject(option);
	            opt.title.text = dsTabName[i];
	            for (j = 0; j < dsSeriesName.length; j++) {
	                opt.series.push(oSeries(dsSeriesName[j], 'solid', dsLeftAxis[i][j], aryColors[j], 0));
	            }
	            for (j = 0; j < dsSeriesName.length; j++) {
	                //add right axis
	                opt.series.push(oSeries(dsSeriesName[j], 'dotted', dsRightAxis[j], aryColors[j], 1));
	                opt.legend.data.push(dsSeriesName[j]);
	            }
	            //refreshChart('overlayChart' + i, opt);
				opts.push(opt);
	        }
			refreshCharts('overlayChart', opts);
			nPeventStartPos = dsSeriesName.length;
	    }

</script>

<script type="text/javascript">

    function getSharedData() {
        var stream = document.getElementById('sharedData').value;
        var allLines = stream.split('~');
        dataSet = [];
        while (allLines.length) {
            dataSet.push(allLines.shift().split(','));
        }
        loadGraph();
    }

    function getLineUpStep(n) {
        nLineUpStep = n;
        loadGraph();
    }

    function getReferenceLine(n) {
        strReferenceLine = n;
        loadGraph();
    }
